import React from 'react';
import { HomePage } from './Pages/HomePage/index'
import { AboutMe } from './Pages/AboutMe/index'
import { Stickers } from './Pages/Stickers/index'
import { CustomOrder } from './Pages/CustomOrder/index'
import { ContactMe } from './Pages/ContactMe/index'
import './styles.css';
import { Switch, Route, Redirect } from 'react-router-dom'
import NavBar from './NavBar/NavBar';

export const Routes = () => {
    return (
        <div>
            <NavBar />
            <Switch>
                <Route exact path="/HomePage" component={HomePage}>
                    <Redirect to="/HomePage" />
                </Route>
                <Route exact path="/AboutMe" component={AboutMe} />
                <Route exact path="/Stickers" component={Stickers} />
                <Route exact path="/CustomOrder" component={CustomOrder} />
                <Route exact path="/ContactMe" component={ContactMe} />
            </Switch>
        </div>
    )
};
